import React from 'react';
import './App.css';
import BackgroundVideo from './Components/VideoBackground/backgroundVideo';
import AppNavbar from './Components//Navbar';
import Accueil from './Components//Accueil';
import Timeline from './Components/Timeline/Timeline';
import SplitScreen from './Components/SplitScreen/SplitScreen';
import Ecole from './Components/SplitScreen/Ecole';
import TBS from './Components/SplitScreen/TBS';


import Split from 'react-split';




function App() {
  return (
    <div className="App">
      <AppNavbar/>
      <BackgroundVideo/>
        <h1 > About Me </h1>
        <p> Get to know me and my formation before dive into my offer </p>
        <p> Petit blabla avec une photo </p>
      <Accueil/>
        <h1> Double Formation : </h1>
      <SplitScreen />
      <Timeline/>
    </div>
  );
}

export default App;
